			<p>941102 FT  02 NOV 94 / People: SE Banken Jouni Kokko, international economist at SG Warburg, is leaving in mid-November to return to his native Finland to be head of market advisory at Enskilda Corporate, the investment banking arm of the Swedish bank SE BANKEN in Helsinki.</p>
